import React from 'react';

const ToDoCard = ({ title, description, done }) => {
  return (
    <>
      <div className="card">
        <div className="card-header">
          <h3>
            {title}
          </h3>
          <div className={done ? 'done' : ''}>

          </div>
        </div>
        <p>
          {description}
        </p>
        <span>
          done: {done}
        </span>
      </div>
      <style jsx>
        {`
          .card {
            border: 1px solid #0000001A;
            border-radius: 7px;
            box-shadow: 3px 5px 10px #0000004D;
            padding: 10px;
            color: #0000008C;
          }
          h3 {
            margin-bottom: 5px;
          }
        `}
      </style>
    </>
  );
};

export default ToDoCard;
